INSERT INTO `v1_55a0fec58ab72ad5029e46044a4d7e946ba7eeef41a69983a7d706f38af4102a` VALUES (1, 3000, "vo_minigame_1013_icon_2_002_001", 2, "訓練はまだ\nここからですわ", "vo_minigame_1013_icon_1_002_001", 2, 1000, 2, "調子が上がって\nきたなっ");
