INSERT INTO `v1_55a0fec58ab72ad5029e46044a4d7e946ba7eeef41a69983a7d706f38af4102a` VALUES (3, 3000, "vo_minigame_1013_icon_2_004_001", 2, "すばらしい\n記録ですわ", "vo_minigame_1013_icon_1_004_001", 2, 10000, 3, "へへっ、おまえら\nやるじゃねえか！");
INSERT INTO `v1_55a0fec58ab72ad5029e46044a4d7e946ba7eeef41a69983a7d706f38af4102a` VALUES (4, 3000, "vo_minigame_1013_icon_2_005_001", 2, "乗りに乗って\nいますわね", "vo_minigame_1013_icon_1_005_001", 3, 10000, 3, "あたしたちはまだ\n止まらねえぜ！");
